import React from 'react';
import { Card, CardTitle } from 'reactstrap';

const Chart = (props) => {
  return (
    <div>
      <Card body className="text-center">
        <CardTitle>Special Title Treatment</CardTitle>
      </Card>
    </div>
  );
};

export default Chart;
